    [],nt"revision_timestamp": "2016-07-27T22:55:26.132712",nt"name": "lacreek-national-wildlife-refuge-annual-narrative-report-calendar-year-1984",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Lacreek
    NWR outlines Refuge accomplishments during the 1984 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses public participation
    and compliance with environmental and cultural resource mandates. Refuge administration
    is outlined; information about personnel, youth programs, funding, safety, and technical
    assistance is given. Habitat management is also covered; subjects include wetlands,
    forests, croplands, grasslands, grazing, haying, fire management, pest control,
    and water rights. The wildlife section of the report discusses endangered and threatened
    species, waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals,
    fisheries resources, wildlife propagation, scientific collections, animal control,
    and marking and bird banding. The public uses of the Refuge described in this report
    include outdoor classrooms, interpretive programs, hunting, fishing, trapping, wildlife
    observation, outdoor recreation, and law enforcement. The equipment and facilities
    section of the report provides information about new construction, rehabilitation,
    major maintenance, and equipment replacement. Cooperative programs and items of
    interest are provided at the end. Refuge brochures and field guides are attached.",nt"license_title":
